pragma solidity ^0.5.0;

contract Papercut {
  // Model a Buyer
  struct Buyer {
    uint id;
    string name;
    uint buyer_saleCount;
  }

  // Store buyer count
  uint public buyerCount;

  // Store accounts that have seats
  mapping(address => bool) public seats_taken;

  // Fetch Buyer
  // Store Buyer
  mapping(uint => Buyer) public buyers;

  //  sold seat event
   event soldEvent (

     uint indexed _buyerId

     );

     constructor() public {
       addBuyer_Seat("Seat A");
       addBuyer_Seat("Seat B");
       addBuyer_Seat("Seat C");
     }

     function addBuyer_Seat(string memory _name) private {
       buyerCount ++;
       buyers[buyerCount] = Buyer(buyerCount, _name, 0);
     }

     function seatPicked (uint _buyerId) public {

       // making sure they have not picked seat before
       // Dont think we will need this
       // keeping just for compile reasons
       require(!seats_taken[msg.sender]);

       // validate buyer
       require(_buyerId > 0 && _buyerId <= buyerCount);

       // require buyer picked seat
       seats_taken[msg.sender] = true;

       // update buyer's seat count
       buyers[_buyerId].buyer_saleCount ++;

       // trigger seat_selction event
       emit soldEvent(_buyerId);
     }
}
